import React, { Component } from 'react';
import Planet from './Planet';
import Starship from './Starship';
import Universe from './universe';

class App extends Component {
  render() {
    return (
      <div className="container">
        <Planet />
        <Starship />
        <Universe />
      </div>
    );
  }
}

export default App;
